    function drawGraph() {

        // parsing and collecting nodes and edges from the python
        nodes = new vis.DataSet([{"color": "#377eb8", "id": "1980-1990_overflate_147", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen atmosfaeriske korrosjonshastigheten avhenger av den totale\u003cbr\u003eeksponeringstiden, total tid med fuktighet p\u00e5\u003cb\u003e overflate\u003c/b\u003en\u003cbr\u003e(v\u00e5ttid), og egenskapene til fuktightsfilmen\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_147\u003cbr\u003etype: usage\u003c/p\u003e", "x": 61.863070803941305, "y": 355.328726446948}, {"color": "#377eb8", "id": "1980-1990_overflate_161", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eP\u00e5 \u003cb\u003eoverflaten\u003c/b\u003e kan man ikke studere bergartene p\u00e5 samme\u003cbr\u003em\u00e5te pga. overdekning og forvitring.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_161\u003cbr\u003etype: usage\u003c/p\u003e", "x": -257.3885633391672, "y": 139.44562160519172}, {"color": "#377eb8", "id": "2012-2019_overflate_2134", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eIsplaneten Jorden har gjennom sin levetid p\u00e5 4,6 milliarder \u00e5r\u003cbr\u003etrolig vaert gjennom perioder som sn\u00f8ball, det vil si dekket av is,\u003cbr\u003esamt flere perioder der st\u00f8rre deler av\u003cb\u003e overflate\u003c/b\u003en har hatt\u003cbr\u003evoksende og avtagende iskapper. Norge og Skandinavia har opplevd mange\u003cbr\u003eistider\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_2134\u003cbr\u003etype: usage\u003c/p\u003e", "x": 219.44563625214357, "y": 622.2500595780392}, {"color": "#377eb8", "id": "2012-2019_overflate_80", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen er et \u00abfremtidslaboratorium\u00bb, for \u00e5 bruke Enzensbergers\u003cbr\u003ebegrep, men ogs\u00e5 og i like stor grad et fortidslaboratorium, som\u003cbr\u003eutfolder seg i de mange lagene, jordlagene, tidslagene,\u003cbr\u003ebetydningslagene som kommer for dagen s\u00e5 snart en l\u00f8fter p\u00e5 en\u003cbr\u003ebrostein eller river et hus. En m\u00e5te \u00e5 forst\u00e5 Berlin p\u00e5 - men ogs\u00e5\u003cbr\u003eOslo - , er som en slags \u00abpalimpsest\u00bb, en \u003cb\u003eoverflate\u003c/b\u003e der\u003cbr\u003ehistorien, begivenheter og mennesker har risset inn sine spor og tegn,\u003cbr\u003eog der det stadig risses inn nye opp\u00e5 og over de gamle.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_80\u003cbr\u003etype: usage\u003c/p\u003e", "x": 198.05672435838696, "y": -522.146486367618}, {"color": "#377eb8", "id": "2012-2019_overflate_4137", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet betyr if\u00f8lge Jord\u00e0 at mer enn halvparten at\u003cbr\u003e\u003cb\u003eoverflaten\u003c/b\u003e p\u00e5 \u00f8yas strender vil forsvinne under b\u00f8lgene.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_4137\u003cbr\u003etype: usage\u003c/p\u003e", "x": -44.933342147061175, "y": 67.78671217363315}, {"color": "#377eb8", "id": "1980-1990_overflate_86", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet var st\u00f8rst gradient i \u003cb\u003eoverflaten\u003c/b\u003e (0 meters\u003cbr\u003edyp).\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_86\u003cbr\u003etype: usage\u003c/p\u003e", "x": 410.51576683492976, "y": -285.7303116495938}, {"color": "#377eb8", "id": "2012-2019_overflate_3066", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSom progmusikkens foregangsartister vet hun \u00e5 sveve p\u00e5 effekten\u003cbr\u003eav gode og seige og dronende gitarbruer, men at hun ogs\u00e5 lager musikk\u003cbr\u003esom er nesten dansbar blir klart p\u00e5 slutten n\u00e5r hun drar i gang den\u003cbr\u003elange, hoggende \u00abHermitage\u00bb, en av de beste l\u00e5tene p\u00e5 albumet som ikke\u003cbr\u003eminst er modig lang, men som blir det perfekte og mest seiglivede\u003cbr\u003elivenummer n\u00e5r ekkoet fra Velvet Underground og Lou Reed stiger til\u003cbr\u003e\u003cb\u003eoverflaten\u003c/b\u003e i s\u00e5 vel refreng som komp.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_3066\u003cbr\u003etype: usage\u003c/p\u003e", "x": -695.4339792195054, "y": -730.0715752518545}, {"color": "#377eb8", "id": "2012-2019_overflate_3960", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBoblene i glasset er et eksempel p\u00e5 s\u00e5kalte minimale\u003cbr\u003e\u003cb\u003eoverflater\u003c/b\u003e som hun har forsket mye p\u00e5. Fakta: Dette vant hun\u003cbr\u003eprisen for Karen Uhlenbeck (76) har f\u00e5tt Abelprisen for sitt\u003cbr\u003e\u00abgrunnleggende arbeid innen geometrisk analyse og gaugeteori som\u003cbr\u003efundamentalt har endret det matematiske landskapet\u00bb, og at hun har\u003cbr\u003eutviklet verkt\u00f8y og metoder som n\u00e5 ligger i verkt\u00f8ykassen til alle\u003cbr\u003egeometere og analytikere. Uhlenbeck tok doktorgrad i matematikk for 50\u003cbr\u003e\u00e5r siden. Hovedomr\u00e5dene omfatter ikke-lineaere partielle\u003cbr\u003edifferensialligninger, differensialgeometri, gaugeteori, topologisk\u003cbr\u003ekvantefeltteori og integrerbare systemer\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_3960\u003cbr\u003etype: usage\u003c/p\u003e", "x": 667.9241336487083, "y": -79.85714281130196}, {"color": "#377eb8", "id": "1980-1990_overflate_190", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBestemmelsen omfatter massetak med sikte p\u00e5 salg eller\u003cbr\u003eindustriell eller naeringsmessig utnytting m.v. dersom det til sammen\u003cbr\u003ekan tas ut minst 1 000 000 m 3 masse og dessuten minst 100 dekker\u003cb\u003e\u003cbr\u003eoverflat\u003c/b\u003ee blir direkte ber\u00f8rt\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_190\u003cbr\u003etype: usage\u003c/p\u003e", "x": 623.1259815901644, "y": -439.52960053033735}, {"color": "#377eb8", "id": "1980-1990_overflate_43", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eBly f\u00e5r gjerne \u003cb\u003eoverflaten\u003c/b\u003e \u00f8delagt, idet den pulveriseres\u003cbr\u003euten konservering.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_43\u003cbr\u003etype: usage\u003c/p\u003e", "x": -37.36162879476311, "y": 665.1300033885708}, {"color": "#377eb8", "id": "2012-2019_overflate_1068", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEt s\u00f8nnetap, et s\u00f8stertap, og p\u00e5 \u003cb\u003eoverflaten\u003c/b\u003e s\u00e5 handler\u003cbr\u003edet om sorg, men dypest sett handler det om glede.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_1068\u003cbr\u003etype: usage\u003c/p\u003e", "x": -750.0, "y": -173.65815504556386}, {"color": "#377eb8", "id": "2012-2019_overflate_3559", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eUnder \u003cb\u003eoverflaten\u003c/b\u003e har det kokt lenge.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_3559\u003cbr\u003etype: usage\u003c/p\u003e", "x": -242.83470221655287, "y": -709.4561749772197}, {"color": "#377eb8", "id": "1980-1990_overflate_109", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI og lIA, - 0,06 mJ for utstyr i gruppe 118, - 0,02 mJ for\u003cbr\u003eutstyr i gruppe lIC. Utstyr som kan \u00e5pnes hurtigere enn den n\u00f8dvendige\u003cbr\u003eforsinkelsestiden for avkj\u00f8ling av indre \u003cb\u003eoverflater\u003c/b\u003e og\u003cbr\u003eutladning av alle involverte kapasiteter, skal vaere spesielt merket\u003cbr\u003emed den n\u00f8dvendige forsinkelsestiden. Unntak fra disse bestemmelsene\u003cbr\u003ekan gj\u00f8res n\u00e5r det f\u00f8lges en spesiell instruks godkjent av\u003cbr\u003eElektrisitetstilsynet, Saerlig tilsyn eller Det stedlige\u003cbr\u003eeltilsy\u003cspan style=\"color:#808080;\"\u003en.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_109\u003cbr\u003etype: usage\u003c/p\u003e", "x": 529.7511664828102, "y": 564.1997767636968}, {"color": "#377eb8", "id": "2012-2019_overflate_2440", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eP\u00e5 vindutsatte steder kan dette gamle sn\u00f8dekket synes i\u003cbr\u003e\u003cb\u003eoverflaten\u003c/b\u003e som et moderat hardt skarelag.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_2440\u003cbr\u003etype: usage\u003c/p\u003e", "x": -344.22184860153345, "y": 594.623321011602}, {"color": "#377eb8", "id": "1980-1990_overflate_119", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFor rekruttering dyrkes \u00f8stersen i s\u00e5kalte \u00abgytepoller\u00bb som er\u003cbr\u003esm\u00e5 poller med ferskvann i \u003cb\u003eoverflaten\u003c/b\u003e og saltvann nedenunder.\u003cbr\u003eFerskvannslaget gir drivhuseffekt, slik at saltvannet under blir s\u00e5\u003cbr\u003evarmt at \u00f8stersen kan gyte. Yngelen setter seg fast p\u00e5 utlagte\u003cbr\u003eyngelsamlere, og yngelen overf\u00f8res senere til oppvekstomr\u00e5der\u003cbr\u003e(\u00abvekstpoller\u00bb) med temperaturer som gir vekst, men ikke\u003cbr\u003egyting.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_119\u003cbr\u003etype: usage\u003c/p\u003e", "x": -223.3291950286868, "y": -175.99849901286493}, {"color": "#377eb8", "id": "2012-2019_overflate_4187", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDen kan bli 50 \u00e5r gammel. Brugden er ufarlig for mennesker og\u003cbr\u003espiser dyreplankton. Den er vanligvis bare sett i \u003cb\u003eoverflaten\u003c/b\u003e\u003cbr\u003emens den spiser dyreplankton. Gapet til brugden er nesten \u00e9n meter\u003cbr\u003ebredt.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_4187\u003cbr\u003etype: usage\u003c/p\u003e", "x": -470.30299593466503, "y": 36.48852242940413}, {"color": "#377eb8", "id": "1980-1990_overflate_99", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDisse tilf\u00f8rslene skyldes hovedsakelig utslipp fra\u003cbr\u003etettbebyggelser, og skulle kunne la seg redusere betraktelig.\u003cbr\u003eBeregningene av vertikal transporten til \u003cb\u003eoverflaten\u003c/b\u003e som f\u00f8lge\u003cbr\u003eav ferskvannstilf\u00f8rslene er beheftet med stor usikkerhet.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_99\u003cbr\u003etype: usage\u003c/p\u003e", "x": 21.1554862252482, "y": -295.1633199159363}, {"color": "#377eb8", "id": "2012-2019_overflate_2549", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSlik greide de \u00e5 samles naer den ene\u003cb\u003e overflate\u003c/b\u003en \u2013\u003cbr\u003eakkurat det vi \u00f8nsket. Ved tusen\u00e5rsskiftet kunne vi derfor lansere de\u003cbr\u003ef\u00f8rste lineskivene av aluminium\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_2549\u003cbr\u003etype: usage\u003c/p\u003e", "x": -331.36927366715645, "y": -412.5601967405821}, {"color": "#377eb8", "id": "1980-1990_overflate_117", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e200 gram diatomittpulver har en \u003cb\u003eoverflate\u003c/b\u003e p\u00e5 ca. 4 da.\u003cbr\u003eDette gj\u00f8r at diatomitt har meget stor absorbsjonsevne og meget lav\u003cbr\u003eegenvekt, og det er saerlig disse egenskaper som utnyttes\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_117\u003cbr\u003etype: usage\u003c/p\u003e", "x": 319.0506843526077, "y": 245.49057444274467}, {"color": "#377eb8", "id": "1980-1990_overflate_195", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eGrensen er satt til 100 000 m 3 masse pr. \u00e5r eller dersom minst\u003cbr\u003e50 dekar \u003cb\u003eoverflate\u003c/b\u003e blir direkte ber\u00f8rt. Disse grensene er under\u003cbr\u003evurdering i departementet i forbindelse med utarbeidelsen av\u003cbr\u003eproposisjonen. 7.17 Ot. prp. nr. 66 (1978\u201479) Om lov om jordskifte o.\u003cbr\u003ea. Den nye jordskifteloven har regler om at jordskifteretten i visse\u003cbr\u003etilfeller kan p\u00e5by samvirke ved uttak av sand og grus.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_195\u003cbr\u003etype: usage\u003c/p\u003e", "x": 212.1829221673191, "y": 12.240479268351907}, {"color": "#377eb8", "id": "1980-1990_overflate_131", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eSeiv om vannkjemien i tabell 3.3.6 ikke viser saerlige\u003cbr\u003eforskjeller mellom\u003cb\u003e overflat\u003c/b\u003ee og bunn, er likevel normalr\u00f8ya,\u003cbr\u003esom lever pelagisk og p\u00e5 gruntomr\u00e5dene, mer utsatt for raske\u003cbr\u003evannkjemiske endringer naer overflaten i forbindelse med flommer v\u00e5r\u003cbr\u003eog h\u00f8s\u003cspan style=\"color:#808080;\"\u003et.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_overflate_131\u003cbr\u003etype: usage\u003c/p\u003e", "x": 602.3684335940535, "y": 171.68761375977095}, {"color": "#377eb8", "id": "2012-2019_overflate_1274", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e5 har ikke Mars noen beboere vi kjenner til - i beste fall kan\u003cbr\u003eplaneten ha mikroskopiske organismer - men det er andre p\u00e5\u003cbr\u003e\u003cb\u003eoverflaten\u003c/b\u003e som allerede har rettet sin fulle oppmerksomhet mot\u003cbr\u003ekometen.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_overflate_1274\u003cbr\u003etype: usage\u003c/p\u003e", "x": -468.26447736122907, "y": 349.5000514349204}]);
